message:
De acordo com a versão oficial, o nome do canal infantil Nickelodeon significa cinema barato (Ingles  Nickel - odeon é um tipo de teatro grego).

Considerando o tipo de programas que este canal transmite, fazendo lavagem cerebral incansavelmente nas crianças ao longo dos anos, a tradução do latim parece mais plausível.

@Quantumclb
